import React, { useState, useEffect } from 'react';
import axios from 'axios';

const ViewMyPackages = () => {
    const [packages, setPackages] = useState([]);

    // Funcție pentru a obține toate pachetele de la server
    const fetchPackages = async () => {
        try {
            const response = await axios.get('http://localhost:8081/package/get-all-packages');
            setPackages(response.data);
        } catch (error) {
            console.error('Error fetching packages:', error);
        }
    };

    useEffect(() => {
        fetchPackages(); // Apelăm funcția pentru a încărca pachetele la început
    }, []);

    return (
        <div>
            <h1>View My Packages</h1>
            <table style={styles.table}>
                <thead>
                    <tr>
                        <th>Package ID</th>
                        <th>Courier Name</th>
                        <th>Created On</th>
                        <th>Delivery Address</th>
                        <th>Status</th>
                    </tr>
                </thead>
                <tbody>
                    {packages.map((pkg) => (
                        <tr key={pkg.id}>
                            <td>{pkg.id}</td>
                            <td>{pkg.courier ? pkg.courier.name : 'N/A'}</td>
                            <td>{pkg.createdOn}</td>
                            <td>{pkg.deliveryAddress || 'N/A'}</td>
                            <td>{pkg.status || 'N/A'}</td>
                        </tr>
                    ))}
                </tbody>
            </table>
        </div>
    );
};

// Stiluri pentru tabel
const styles = {
    table: {
        width: '100%',
        borderCollapse: 'collapse',
        marginTop: '20px',
    },
    th: {
        backgroundColor: '#f4f4f4',
        padding: '10px',
        textAlign: 'left',
        border: '1px solid #ddd',
    },
    td: {
        padding: '10px',
        textAlign: 'left',
        border: '1px solid #ddd',
    },
};

export default ViewMyPackages;
